import requests
import base64
import io

BASE_URL = "https://localhost:8443"

# Example 64-byte test image
TEST_IMAGE_BASE64_CLASS = (
    ""
)

TEST_IMAGE_BASE64_SEG = (
    ""
)

def decode_image(img_base64):
    return io.BytesIO(base64.b64decode(img_base64))

def test_classification():
    files = {"image": ("test.jpg", decode_image(TEST_IMAGE_BASE64_CLASS), "image/jpeg")}
    r = requests.post(f"{BASE_URL}/classification", files=files, verify=False)
    assert r.status_code == 200
    assert "prediction" in r.json()

def test_segmentation():
    files = {"image": ("test.jpg", decode_image(TEST_IMAGE_BASE64_SEG), "image/jpeg")}
    r = requests.post(f"{BASE_URL}/segmentation", files=files, verify=False)
    assert r.status_code == 200
    assert r.headers["Content-Type"] == "image/jpeg"
